import { useState } from "react"
import { Link, useParams } from "react-router-dom";

const DependentsPrompt = () => {
    const [message, setMessage] = useState("Successfully created a new customer.");
    const [customer, setCustomer] = useState(null);
    const {id} = useParams();
  return (
    <main>
    <dialog id="dependents-prompt" open>
        <p class="message">
            {message}
        </p>
        <h2 class="title">Does the customer have dependents?</h2>
        <div class="khamco-buttons">
            <Link to={`/customers/create-dependent/$customer.id`}>Yes</Link>
            <Link to={`/customers/${customer._id}`}>No</Link>
        </div>
    </dialog>
</main>
  )
}

export default DependentsPrompt
